var correoUrl=global_settings.urlCORS+"api/correoapi/";registrationModule.factory("correoRepository",function(r){return{get:function(o){return r.get(correoUrl+"0-"+o)},getAll:function(o,e,t){return r.get(correoUrl+"1-"+o+"-"+e+"-"+t)},add:function(o){return r.post(correoUrl,o)},"delete":function(o){return r["delete"](correoUrl+o.idCorreo)},put:function(o){return r.put(correoUrl,o)}}});